(40, 1, '2023-09-26 14:18:26', '2023-09-26 12:18:26', '<p>\"Välkommen till FashionFusion – din port till trendig och tidlös stil. Upptäck det senaste modet och tidlösa klassiker, allt på ett ställe. Utforska vår samling av unika och eleganta kläder som låter dig uttrycka din stil. Oavsett om du söker efter det perfekta vardagsplagget eller en showstoppare till speciella tillfällen, har vi något för varje tillfälle. Bli en del av vår fashionfamilj och låt ditt modeäventyr börja här.</p>', 'Exempelsida', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2023-09-26 14:18:26', '2023-09-26 12:18:26', '', 2, 'http://localhost:8888/FashionFusion/wordpress%20/?p=40', 0, 'revision', '', 0),
(41, 1, '2023-09-26 14:19:28', '2023-09-26 12:19:28', 'Välkommen till FashionFusion – din port till trendig och tidlös stil. Upptäck det senaste modet och tidlösa klassiker, allt på ett ställe. Utforska vår samling av unika och eleganta kläder som låter dig uttrycka din stil. Oavsett om du söker efter det perfekta vardagsplagget eller en showstoppare till speciella tillfällen, har vi något för varje tillfälle. Bli en del av vår fashionfamilj och låt ditt modeäventyr börja här.', 'Exempelsida', '', 'inherit', 'closed', 'closed', '', '2-autosave-v1', '', '', '2023-09-26 14:19:28', '2023-09-26 12:19:28', '', 2, 'http://localhost:8888/FashionFusion/wordpress%20/?p=41', 0, 'revision', '', 0),
(42, 1, '2023-09-26 14:20:51', '2023-09-26 12:20:51', 'Välkommen till FashionFusion – din port till trendig och tidlös stil. Upptäck det senaste modet och tidlösa klassiker, allt på ett ställe. Utforska vår samling av unika och eleganta kläder som låter dig uttrycka din stil. Oavsett om du söker efter det perfekta vardagsplagget eller en showstoppare till speciella tillfällen, har vi något för varje tillfälle. Bli en del av vår fashionfamilj och låt ditt modeäventyr börja här.', 'FashionFusion', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2023-09-26 14:20:51', '2023-09-26 12:20:51', '', 2, 'http://localhost:8888/FashionFusion/wordpress%20/?p=42', 0, 'revision', '', 0),
