(46, 1, '2023-09-26 15:39:33', '2023-09-26 13:39:33', '<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Tillverkad av 100% mjuk bomull.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Bekväm passform med utmärkt andningsförmåga.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Rundad halsringning för en avslappnad stil.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tillgänglig i en rad trendiga färger för att matcha din personliga stil.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Mångsidig och perfekt att kombinera med jeans, byxor eller kjolar.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->', 'Original', 'Original är kända för sin komfort och lätta känsla. Det är oftast lätta att ta på och av och ger fri rörlighet.', 'publish', 'open', 'closed', '', 'original', '', '', '2023-09-26 15:57:07', '2023-09-26 13:57:07', '', 0, 'http://localhost:8888/FashionFusion/wordpress%20/?post_type=product&#038;p=46', 0, 'product', '', 0),
